sys_variable_value.value:
(function execute(inputs, outputs) {
  // Only parse the response body if the status code is 200	
  if (inputs.status_code == '200'){

    // Parse the response_body input variable and save parsed object as responseBody
    var responseBody = JSON.parse(inputs.response_body);
    var racesArray = [];

    for (var raceLoop = 0; raceLoop < responseBody.races.length; raceLoop++)
    {
      var raceObject = {
        eventArray: []
      };
      raceObject.race_id = responseBody.races[raceLoop].race.race_id;
      raceObject.name = responseBody.races[raceLoop].race.name;
      raceObject.url = responseBody.races[raceLoop].race.url;
      raceObject.last_date = responseBody.races[raceLoop].race.last_date;
      raceObject.next_date = responseBody.races[raceLoop].race.next_date;
      raceObject.is_registration_open = responseBody.races[raceLoop].race.is_registration_open;
      raceObject.is_draft_race = responseBody.races[raceLoop].race.is_draft_race;

       gs.info(raceObject.name + ' Events: '+responseBody.races[raceLoop].race.events.length);
      /* Events */ 
      for (var eventLoop = 0; eventLoop < responseBody.races[raceLoop].race.events.length; eventLoop++)
      {
        var eventObject = {};
        eventObject.event_id = responseBody.races[raceLoop].race.events[eventLoop].event_id;
        eventObject.name = responseBody.races[raceLoop].race.events[eventLoop].name;
        eventObject.distance = responseBody.races[raceLoop].race.events[eventLoop].distance;
		gs.info(raceObject.name + ': ' + eventObject.event_id);
		gs.info(raceObject.name + ': ' + eventObject.name);
		gs.info(raceObject.name + ': ' + eventObject.distance);


        //raceObject.eventArray[eventLoop].push(eventObject);
      }
      /* Events */

      racesArray[raceLoop] = raceObject;
    }


    // split the returned location into separate latitude and longitude values
    //var locArray = responseBody.loc.split(",");
    //outputs.latitude = locArray[0];
    //outputs.longitude = locArray[1];
    outputs.races = racesArray;	
  }
})(inputs, outputs);

